import { Link } from "react-router-dom";

export default function NavBar() {
    return(
    <nav>
        <Link to="/" style={{ padding: "10px" }}>
            Home
        </Link>
        <Link to="/sign-up" style={{ padding: "10px" }}>
            Register
        </Link>
        <Link to="/sign-in" style={{ padding: "10px" }}>
            Login
        </Link>
    </nav>
    )
}
